      CPU: 'CPU: Intel Core i5 Thế hệ 10, 1.10 GHz',
      RAM: 'RAM: 8 GB, LPDDR4X (On board), 3733 MHz',
      OCung: 'Ổ cứng: SSD: 256 GB',
      manHinh: 'Màn hình: 13.3 inch, Retina (2560 x 1600)',
      VGA: 'Card màn hình: Card đồ họa tích hợp, Intel Iris Plus Graphics',
      congKetNoi: 'Cổng kết nối: 2 x Thunderbolt 3 (USB-C)',
      heDieuHanh: 'Hệ điều hành: Mac OS',
      thietKe: 'Thiết kế: Vỏ kim loại nguyên khối, PIN liền',
      kichThuoc: 'Kích thước: Dày 4.1 mm đến 16.1 mm, 1.29 kg',
      raMat: 'Thời điểm ra mắt: 2020',
      noidung: 'MacBook Air 2020 là phiên bản có nhiều nâng cấp vượt trội về cấu hình và thiết kế bàn phím, hứa hẹn đem tới trải nghiệm mượt mà, thoải mái hơn tới người dùng. Chiếc máy vẫn là lựa chọn số 1 dành cho các anh em văn phòng muốn sở hữu chiếc laptop mỏng nhẹ, mượt mà và pin lâu.\nHiệu năng vượt trội với CPU đời mới\nCó thể nói, hiệu năng là điểm nâng cấp mạnh mẽ nhất của MacBook Air 2020 khi lần đầu tiên một chiếc MacBook Air được trang bị con chip 4 nhân - Intel Core i5 thế hệ 10 (mới nhất đầu năm 2020), đi kèm cùng thanh RAM 8 GB đáp ứng tốt tác vụ đa nhiệm.\nVà tất nhiên, MacBook Air 2020 sở hữu một ổ cứng SSD 256 GB cho thời gian khởi động máy, mở tập tin, ứng dụng nhanh chóng, mọi thao tác được đáp ứng ngay lập tức.\nKèm theo con chip này là card đồ họa tích hợp Intel Iris Plus, cung cấp hiệu năng đồ họa ấn tượng, đáp ứng tốt nhu cầu Photoshop, chỉnh sửa video đơn giản,...\nTheo Apple, MacBook Air 2020 sẽ cho hiệu suất CPU gấp đôi và khả năng đồ họa cải thiện tới 80% so với thế hệ 2019.\nThay đổi thiết kế bàn phím\nMacBook Air 2020 sử dụng thiết kế bàn phím mới, tương tự đàn anh Macbook Pro 16 inch 2019, đó là Magic Keyboard với trải nghiệm gõ nhanh nhạy, thoải mái và yên tĩnh.\nĐây là thay đổi khá thú vị trên MacBook Air 2020 khi đã loại bỏ hoàn toàn thiết kế cũ, vốn gặp phải nhiều đánh giá trái chiều (bàn phím cánh bướm).\nBàn phím này cũng có đèn nền đi kèm các cảm biến ánh sáng sẽ giúp bạn nhìn rõ các ký tự ngay cả khi trời tối.\nKhông hề sai khi nói rằng một khi đã sử dụng bàn rê chuột (trackpad) trên các dòng MacBook, bạn sẽ quên đi con chuột trên bàn vì sự tiện lợi và thao tác chính xác của nó.\nVới công nghệ đa điểm Force Touch thông minh, cùng kích thước lớn hơn 20% (so với thế hệ 2017), bàn rê chuột trên MacBook Air 2020 đã phát huy tối đa những ưu điểm vốn có của nó, đem lại một trải nghiệm sử dụng hoàn hảo.\nThiết kế sang trọng, bảo vệ môi trường\nVẫn lối thiết kế đơn giản mà sang trọng, MacBook Air 2020 sở hữu thân máy nhôm nguyên khối được hoàn thiện đến từng chi tiết, những góc cắt tinh xảo và bề mặt được xử lý mịn màng, không tì vết.\nChiếc máy vẫn rất mỏng và nhẹ theo đúng tên gọi "Air". Chỗ dày nhất trên thiết bị chỉ 16.1 mm, trọng lượng 1.29 kg, các đường vuốt mỏng dần về phía cạnh còn giúp máy trông mỏng hơn so với thực tế\nVề tổng thể, thiết kế này không có nhiều thay đổi kể từ phiên bản 2018, Apple vẫn duy trì sử dụng 100% nhôm tái chế, giúp MacBook Air 2020 trở thành sản phẩm “xanh”, góp phần bảo vệ môi trường.\nMàn hình Retina sắc nét, hiển thị 4 tỷ màu\nTương tự thế hệ 2019, MacBook Air 2020 sở hữu màn hình 13.3 inch chuẩn Retina sắc nét, cho khả năng hiển thị 4 tỷ màu, hứa hẹn chất lượng hình ảnh chính xác và trung thực nhất.\nCông nghệ True Tone nổi tiếng của Apple tiếp tục được sử dụng trên MacBook Air 2020, giúp tinh chỉnh màu sắc thông minh dựa vào môi trường, đảm bảo sự thoải mái cho mắt người dùng khi phải nhìn màn hình trong thời gian dài.\nCổng kết nối “một cho tất cả”\nMacBook Air 2020 được trang bị 2 cổng Thunderbolt 3 (USB Type-C), cả hai đều hỗ trợ đầy đủ các tiện ích từ sạc pin, kết nối cho đến lưu trữ, trình chiếu,... cao cấp hơn là khả năng xuất ra độ phân giải 6K và tính năng kết nối tới eGPU rời.\nBên cạnh đó, jack 3.5 mm vẫn được giữ lại trên MacBook Air 2020, đáp ứng nhu cầu nghe nhạc, giải trí audio truyền thống của một lượng lớn người dùng.\nMacBook của Apple luôn là một trong những dòng laptop có thời lượng pin hàng đầu hiện nay, MacBook Air 2020 cũng không phải ngoại lệ.\nVới thời lượng pin lên đến hơn 10 giờ sử dụng liên tục, MacBook Air 2020 đảm bảo mọi công việc của bạn được hoàn thành trọn vẹn, không bị gián đoạn giữa chừng vì hết pin, đi kèm đó là củ sạc công suất lớn - 30W giúp rút ngắn thời gian sạc pin.\nNgoài việc giữ những ưu điểm của Air 2019, Apple MacBook Air 2020 được nâng cấp những tính năng như sử dụng chip 4 nhân cùng card đồ hoạ mạnh cho hiệu năng cao, có thể “cân tốt” màn hình ngoài chất lượng 6K và thiết kế bàn phím mới, xứng đáng với số tiền bỏ ra.\nBài viết này có hữu ích cho Bạn không ?\n\n\nHữu ích\nKhông Hữu ích\n\n\nLaptop Apple MacBook Air 2020 i5 1.1GHz/8GB/256GB (Z0YL)\n30.990.000₫\nMUA NGAY\nMUA TRẢ GÓP\nTRẢ GÓP QUA THẺ'
