      noidung: 'Xử lý nhanh chóng mọi công việc hay thiết kế đồ họa chuyên nghiệp với Lenovo Ideapad S145 15IWL nhờ Chip Intel Core i7, RAM 8 GB. Thiết kế đơn giản, thanh lịch và gọn nhẹ, Lenovo Ideapad trở thành sự lựa chọn của dân văn phòng và sinh viên năng động.\nCấu hình mạnh mẽ, thiết kế chuyên nghiệp\nLenovo Ideapad S145 15IWL mang Chip Intel Core i7 thế hệ 8 cùng hệ điều hành Windows 10, cho phép người dùng thao tác dễ dàng trên các ứng dụng văn phòng (bộ công cụ Microsoft Office) cho đến đồ họa 3D chuyên sâu bằng Photoshop, Ai, Lightroom,...\nRAM 8 GB đa nhiệm tốt, giữ máy hoạt động êm ái khi mở cùng lúc 30 tab.\nVới laptop Lenovo Ideapad, bạn chỉ mất tối đa 10 giây chờ máy khởi động và thực hiện ngay ý tưởng của mình nhờ ổ cứng SSD 512 GB.\nDung lượng ổ cứng cực lớn để lưu trữ hết mọi tài liệu và ứng dụng nặng mà không cần dùng thêm phụ kiện hỗ trợ nào.\nVới việc sử dụng card đồ họa rời NVIDIA GeForce MX110 2 GB, máy chạy được các game như LOL hay FIFA mà không còn ngại hình ảnh bị lag. Card đồ họa rời cũng giúp việc sử dụng đồ họa mượt hơn.\nMàn hình sắc nét, dễ nhìn ngoài trời\nKích thước màn hình 15.6 inch rộng rãi kèm theo viền màn hình mỏng tạo không gian hiển thị rộng hơn kích thước thật của máy. \nTrải nghiệm xem phim và làm việc đã mắt hơn với độ phân giải Full HD và lớp chống chói giúp người dùng vẫn có thể nhìn được những hình ảnh sống động nhất khi ở nơi ánh sáng mạnh.\nThiết kế gọn nhẹ\nBề ngoài máy khá đơn giản, vỏ máy nhựa màu xám trung tính mặt lưng nhám, các góc cạnh vuông góc mạnh mẽ mà cũng tôn lên nét thanh lịch cho máy. Trọng lượng laptop Lenovo là 1.73 kg khá nhẹ và rất dễ mang theo đi học, đi làm. \nDolby Home Theater là công nghệ âm thanh được hãng Dolby phát triển riêng cho các thiết bị giải trí tại gia. Công nghệ âm thanh này tập trung vào khả năng mang đến âm thanh vòm trên loa ngoài hay trên headphone hoặc hệ thống loa khi được kết nối.\nPin sử dụng được khoảng 5 tiếng \nLaptop trụ được khoảng 5 giờ đồng hồ sử dụng liên tục. Đây là mức pin trung bình, phù hợp với công việc văn phòng, học tập. \nBài viết này có hữu ích cho Bạn không ?\n\n\nHữu ích\nKhông Hữu ích\n\n\nLaptop Lenovo Ideapad S145 15IWL i7 8565U/8GB/512GB/2GB MX110/Win10 (81MV00TAVN)\n17.190.000₫\nMUA NGAY\nMUA TRẢ GÓP 0%\nTRẢ GÓP QUA THẺ'
