      raMat: 'Thời điểm ra mắt: 2020',
      noidung: 'MacBook Air 2020 i3 mới với thiết kế sang trọng, hiệu năng khá, bàn phím Magic lần đầu tiên xuất hiện trên dòng Macbook Air. Với nhiều tính năng hiện đại, đây là chiếc MacBook Air rất đáng sở hữu với mức giá gần như rẻ nhất từ trước đến nay. \n"Cân tất" ứng dụng văn phòng\nMacBook Air phiên bản 2020 có cấu hình gồm CPU Intel Core i3 thế hệ 10 mới nhất hiện nay, RAM 8 GB có nhiều cải tiến, khả năng đồ họa cải thiện tới 80% so với thế hệ 2019.\nKhi sử dụng các thao tác cơ bản như tách nền, cắt ghép hình ảnh trên Photoshop hay mở một lúc khoảng 20 tab Chrome, máy hoạt động mượt và không có hiện tượng giật lag. \nMáy còn trang bị card đồ họa tích hợp Intel Iris Plus hỗ trợ đồ họa tốt hơn khi sử dụng thiết kế đồ họa 2D.\nLaptop vận hành nhanh chóng nhờ có ổ cứng SSD 256 GB mở máy cực nhanh, xử lí trơn tru các tác vụ thông thường. Bộ nhớ 256 GB đủ rộng để lưu được rất nhiều dữ liệu. \nTheo như Apple công bố, MacBook Air 2020 có thời lượng pin sử dụng được khoảng 10 giờ liên tục. Với thời lượng dài như vậy, MacBook đủ sức đồng hành cùng bạn cả ngày dài học tập và làm việc. \nHiển thị sắc nét, màu sắc sống động với công nghệ TrueTone\nMàn hình Retina (2560 x 1600) rộng 13.3 inch trứ danh cho hình ảnh sắc nét đến từng chi tiết, màu sắc chính xác hơn bao giờ hết với công nghệ TrueTone - tinh chỉnh màu sắc tự động tùy theo môi trường sử dụng.\nNgoài ra, góc nhìn của máy cũng rộng hơn nhờ có công nghệ IPS đem lại trải nghiệm nhìn đã mắt, chìm đắm trong không gian hình ảnh sống động.\nBàn phím Magic và trackpad cao cấp\nỞ phiên bản MacBook Air 2020, Apple đã sử dụng bàn phím kéo cắt thay vì bàn phím cánh bướm và sử dụng bàn phím như các thế hệ trước. Bàn phím này có hành trình phím 1 mm, độ nảy cao cho cảm giác gõ phím êm ái, soạn thảo nhanh. \nTrackpad cảm ứng lực có kích thước lớn hơn 20% tốc độ nhanh, dễ điều khiển với đa dạng cử chỉ như chụm, thu phóng,...\nMỏng nhẹ, sang trọng từ kim loại tái chế\nMacBook Air 2020 giữ nguyên thiết kế sang trọng quen thuộc. Với vỏ kim loại nguyên khối cùng các góc cạnh được vát gọt tỉ mỉ, MacBook Air mang đến vẻ ngoài hoàn hảo, mỏng nhẹ đầy đẳng cấp. \nMáy có trọng lượng 1.29 kg, mỏng chỉ 16.1 mm, kích thước nhỏ gọn dễ dàng cho vào túi xách hoặc balo đem theo bên mình. \nBảo mật an toàn \nCác sản phẩm của Apple vốn chưa bao giờ làm người dùng thất vọng về khả năng bảo mật. MacBook Air 2020 cũng sử dụng chip bảo mật T2 như các đàn anh đi trước của mình.\nTính năng Touch ID - bảo mật bằng vân tay giúp bạn mở máy cực nhanh, thanh toán dễ dàng qua Apple Pay. Bên cạnh đó, “Hey Siri” luôn sẵn sàng lắng nghe để hỗ trợ bạn. \nMáy sử dụng hệ điều MacOS đem lại nhiều tiện ích cùng với chế độ bảo mật cao cho người dùng. \nApple trang bị cho MacBook Air 2020 i3 2 cổng Thunderbolt 3 (USB-C) hiện đại để kết nối cắm sạc và truyền dữ liệu hay kết nối với các thiết bị khác.\nVới cấu hình vừa đủ, thiết kế mỏng nhẹ, sang trọng, Macbook Air 2020 i3 là một món quà dành cho dân văn phòng hay doanh nhân thường xuyên đi công tác, làm việc với máy tính trong lúc di chuyển. \nBài viết này có hữu ích cho Bạn không ?\n\n\nHữu ích\nKhông Hữu ích\n\n\nLaptop Apple MacBook Air 2020 i3 1.1GHz/8GB/256GB (MWTL2SA/A)\n28.990.000₫\nMUA NGAY\nMUA TRẢ GÓP\nTRẢ GÓP QUA THẺ'
